import Button from '@material-ui/core/Button';


const styles = theme => ({
  textField: {
    paddingTop: 8,
    paddingBottom: 8,
    width: 200,
  },
  button: {
    margin: theme.spacing(1),
  }
})

const style = {
  backgroundStyle: {
    backgroundColor: "#ffcccc"
  }
}

